import{_ as n,o as s,c as a,e}from"./app.71cf0aba.js";var t="/images/Book/\uC624\uBE0C\uC81D\uD2B8/5\uC7A5/1.png",p="/images/Book/\uC624\uBE0C\uC81D\uD2B8/5\uC7A5/2.png",o="/images/Book/\uC624\uBE0C\uC81D\uD2B8/5\uC7A5/3.png",i="/images/Book/\uC624\uBE0C\uC81D\uD2B8/5\uC7A5/4.png",c="/images/Book/\uC624\uBE0C\uC81D\uD2B8/5\uC7A5/5.png",l="/images/Book/\uC624\uBE0C\uC81D\uD2B8/5\uC7A5/6.png",u="/images/Book/\uC624\uBE0C\uC81D\uD2B8/5\uC7A5/7.png",r="/images/Book/\uC624\uBE0C\uC81D\uD2B8/5\uC7A5/8.png";const d={},k=e('<h1 id="_5\u110C\u1161\u11BC-\u110E\u1162\u11A8\u110B\u1175\u11B7-\u1112\u1161\u11AF\u1103\u1161\u11BC\u1112\u1161\u1100\u1175" tabindex="-1"><a class="header-anchor" href="#_5\u110C\u1161\u11BC-\u110E\u1162\u11A8\u110B\u1175\u11B7-\u1112\u1161\u11AF\u1103\u1161\u11BC\u1112\u1161\u1100\u1175" aria-hidden="true">#</a> 5\uC7A5. \uCC45\uC784 \uD560\uB2F9\uD558\uAE30</h1><h2 id="_1-\u110E\u1162\u11A8\u110B\u1175\u11B7-\u110C\u116E\u1103\u1169-\u1109\u1165\u11AF\u1100\u1168\u1105\u1173\u11AF-\u1112\u1163\u11BC\u1112\u1162" tabindex="-1"><a class="header-anchor" href="#_1-\u110E\u1162\u11A8\u110B\u1175\u11B7-\u110C\u116E\u1103\u1169-\u1109\u1165\u11AF\u1100\u1168\u1105\u1173\u11AF-\u1112\u1163\u11BC\u1112\u1162" aria-hidden="true">#</a> 1. \uCC45\uC784 \uC8FC\uB3C4 \uC124\uACC4\uB97C \uD5A5\uD574</h2><p>\uB370\uC774\uD130 \uC911\uC2EC\uC758 \uC124\uACC4\uC5D0\uC11C \uCC45\uC784 \uC911\uC2EC\uC758 \uC124\uACC4\uB85C \uC804\uD658\uD558\uAE30 \uC704\uD574\uC11C\uB294 \uB2E4\uC74C\uC758 \uB450 \uAC00\uC9C0 \uC6D0\uCE59\uC744 \uB530\uB77C\uC57C \uD55C\uB2E4.</p><ul><li>\uB370\uC774\uD130\uBCF4\uB2E4 \uD589\uB3D9\uC744 \uBA3C\uC800 \uACB0\uC815\uD558\uB77C</li><li>\uD611\uB825\uC774\uB77C\uB294 \uBB38\uB9E5 \uC548\uC5D0\uC11C \uCC45\uC784\uC744 \uACB0\uC815\uD558\uB77C</li></ul><h3 id="\u1103\u1166\u110B\u1175\u1110\u1165\u1107\u1169\u1103\u1161-\u1112\u1162\u11BC\u1103\u1169\u11BC\u110B\u1173\u11AF-\u1106\u1165\u11AB\u110C\u1165-\u1100\u1167\u11AF\u110C\u1165\u11BC\u1112\u1161\u1105\u1161" tabindex="-1"><a class="header-anchor" href="#\u1103\u1166\u110B\u1175\u1110\u1165\u1107\u1169\u1103\u1161-\u1112\u1162\u11BC\u1103\u1169\u11BC\u110B\u1173\u11AF-\u1106\u1165\u11AB\u110C\u1165-\u1100\u1167\u11AF\u110C\u1165\u11BC\u1112\u1161\u1105\u1161" aria-hidden="true">#</a> \uB370\uC774\uD130\uBCF4\uB2E4 \uD589\uB3D9\uC744 \uBA3C\uC800 \uACB0\uC815\uD558\uB77C</h3><p>\uCC45\uC784 \uC911\uC2EC\uC758 \uC124\uACC4\uC5D0\uC11C\uB294 \uAC1D\uCCB4\uC758 \uD589\uB3D9, \uC989 \uCC45\uC784\uC744 \uBA3C\uC800 \uACB0\uC815\uD55C \uD6C4\uC5D0 \uAC1D\uCCB4\uC758 \uC0C1\uD0DC\uB97C \uACB0\uC815\uD55C\uB2E4.</p><h3 id="\u1112\u1167\u11B8\u1105\u1167\u11A8\u110B\u1175\u1105\u1161\u1102\u1173\u11AB-\u1106\u116E\u11AB\u1106\u1162\u11A8-\u110B\u1161\u11AB\u110B\u1166\u1109\u1165-\u110E\u1162\u11A8\u110B\u1175\u11B7\u110B\u1173\u11AF-\u1100\u1167\u11AF\u110C\u1165\u11BC\u1112\u1161\u1105\u1161" tabindex="-1"><a class="header-anchor" href="#\u1112\u1167\u11B8\u1105\u1167\u11A8\u110B\u1175\u1105\u1161\u1102\u1173\u11AB-\u1106\u116E\u11AB\u1106\u1162\u11A8-\u110B\u1161\u11AB\u110B\u1166\u1109\u1165-\u110E\u1162\u11A8\u110B\u1175\u11B7\u110B\u1173\u11AF-\u1100\u1167\u11AF\u110C\u1165\u11BC\u1112\u1161\u1105\u1161" aria-hidden="true">#</a> \uD611\uB825\uC774\uB77C\uB294 \uBB38\uB9E5 \uC548\uC5D0\uC11C \uCC45\uC784\uC744 \uACB0\uC815\uD558\uB77C</h3><p>\uD611\uB825\uC5D0 \uC801\uD569\uD55C \uCC45\uC784\uC744 \uC218\uD655\uD558\uAE30 \uC704\uD574\uC11C\uB294 \uAC1D\uCCB4\uB97C \uACB0\uC815\uD55C \uD6C4\uC5D0 \uBA54\uC2DC\uC9C0\uB97C \uC120\uD0DD\uD558\uB294 \uAC83\uC774 \uC544\uB2C8\uB77C <strong>\uBA54\uC2DC\uC9C0\uB97C \uACB0\uC815\uD55C \uD6C4\uC5D0 \uBA54\uC2DC\uC9C0 \uC2A4\uC2A4\uB85C \uAC1D\uCCB4\uB97C \uC120\uD0DD\uD574\uC57C \uD55C\uB2E4</strong>.</p><p>\uD611\uB825\uC774\uB77C\uB294 \uBB38\uB9E5 \uC548\uC5D0\uC11C \uBA54\uC2DC\uC9C0\uC5D0 \uC9D1\uC911\uD558\uB294 \uCC45\uC785 \uC911\uC2EC\uC758 \uC124\uACC4\uB294 \uCEA1\uC290\uD654\uC758 \uC6D0\uB9AC\uB97C \uC9C0\uD0A4\uAE30\uAC00 \uD6E8\uC52C \uC26C\uC6CC\uC9C4\uB2E4.</p><h3 id="\u110E\u1162\u11A8\u110B\u1175\u11B7-\u110C\u116E\u1103\u1169-\u1109\u1165\u11AF\u1100\u1168" tabindex="-1"><a class="header-anchor" href="#\u110E\u1162\u11A8\u110B\u1175\u11B7-\u110C\u116E\u1103\u1169-\u1109\u1165\u11AF\u1100\u1168" aria-hidden="true">#</a> \uCC45\uC784 \uC8FC\uB3C4 \uC124\uACC4</h3><p>\uB2E4\uC74C\uC740 3\uC7A5\uC5D0\uC11C \uC124\uBA85\uD55C \uCC45\uC784 \uC8FC\uB3C4 \uC124\uACC4\uC758 \uD750\uB984\uC744 \uB2E4\uC2DC \uB098\uC5F4\uD55C \uAC83\uC774\uB2E4.</p><ul><li>\uC2DC\uC2A4\uD15C\uC774 \uC0AC\uC6A9\uC790\uC5D0\uAC8C \uC81C\uACF5\uD574\uC57C \uD558\uB294 \uAE30\uB2A5\uC778 \uC2DC\uC2A4\uD15C \uCC45\uC784\uC744 \uD30C\uC545\uD55C\uB2E4.</li><li>\uC2DC\uC2A4\uD15C \uCC45\uC784\uC744 \uB354 \uC791\uC740 \uCC45\uC784\uC73C\uB85C \uBD84\uD560\uD55C\uB2E4.</li><li>\uBD84\uD560\uB41C \uCC45\uC784\uC744 \uC218\uD589\uD560 \uC218 \uC788\uB294 \uC801\uC808\uD55C \uAC1D\uCCB4 \uB610\uB294 \uC5ED\uD560\uC744 \uCC3E\uC544 \uCC45\uC784\uC744 \uD560\uB2F9\uD55C\uB2E4.</li><li>\uAC1D\uCCB4\uAC00 \uCC45\uC784\uC744 \uC218\uD589\uD558\uB294 \uB3C4\uC911 \uB2E4\uB978 \uAC1D\uCCB4\uC758 \uB3C4\uC6C0\uC774 \uD544\uC694\uD55C \uACBD\uC6B0 \uC774\uB97C \uCC45\uC784\uC9C8 \uC801\uC808\uD55C \uAC1D\uCCB4 \uB610\uB294 \uC5ED\uD560\uC744 \uCC3E\uB294\uB2E4.</li><li>\uD574\uB2F9 \uAC1D\uCCB4 \uB610\uB294 \uC5ED\uD560\uC5D0\uAC8C \uCC45\uC784\uC744 \uD560\uB2F9\uD568\uC73C\uB85C\uC368 \uB450 \uAC1D\uCCB4\uAC00 \uD611\uB825\uD558\uAC8C \uD55C\uB2E4.</li></ul><h2 id="_2-\u110E\u1162\u11A8\u110B\u1175\u11B7-\u1112\u1161\u11AF\u1103\u1161\u11BC\u110B\u1173\u11AF-\u110B\u1171\u1112\u1161\u11AB-grasp-\u1111\u1162\u1110\u1165\u11AB" tabindex="-1"><a class="header-anchor" href="#_2-\u110E\u1162\u11A8\u110B\u1175\u11B7-\u1112\u1161\u11AF\u1103\u1161\u11BC\u110B\u1173\u11AF-\u110B\u1171\u1112\u1161\u11AB-grasp-\u1111\u1162\u1110\u1165\u11AB" aria-hidden="true">#</a> 2. \uCC45\uC784 \uD560\uB2F9\uC744 \uC704\uD55C GRASP \uD328\uD134</h2><p>GRASP \uD328\uD134\uC740 &quot;General Responsibility Assignment Software Pattern(\uC77C\uBC18\uC801\uC778 \uCC45\uC784 \uD560\uB2F9\uC744 \uC704\uD55C \uC18C\uD504\uD2B8\uC6E8\uC5B4 \uD328\uD134)&quot;\uC758 \uC57D\uC790\uB85C <strong>\uAC1D\uCCB4\uC5D0\uAC8C \uCC45\uC784\uC744 \uD560\uB2F9\uD560 \uB54C \uC9C0\uCE68\uC73C\uB85C \uC0BC\uC744 \uC218 \uC788\uB294 \uC6D0\uCE59\uB4E4\uC758 \uC9D1\uD569</strong>\uC744 \uD328\uD134 \uD615\uC2DD\uC73C\uB85C \uC815\uB9AC\uD55C \uAC83\uC774\uB2E4.</p><h3 id="\u1103\u1169\u1106\u1166\u110B\u1175\u11AB-\u1100\u1162\u1102\u1167\u11B7\u110B\u1166\u1109\u1165-\u110E\u116E\u11AF\u1107\u1161\u11AF\u1112\u1161\u1100\u1175" tabindex="-1"><a class="header-anchor" href="#\u1103\u1169\u1106\u1166\u110B\u1175\u11AB-\u1100\u1162\u1102\u1167\u11B7\u110B\u1166\u1109\u1165-\u110E\u116E\u11AF\u1107\u1161\u11AF\u1112\u1161\u1100\u1175" aria-hidden="true">#</a> \uB3C4\uBA54\uC778 \uAC1C\uB150\uC5D0\uC11C \uCD9C\uBC1C\uD558\uAE30</h3><p><img src="'+t+'" alt="1"></p><p>\uC704\uC758 \uADF8\uB9BC\uC740 \uC601\uD654 \uC608\uB9E4 \uC2DC\uC2A4\uD15C\uC744 \uAD6C\uC131\uD558\uB294 \uB3C4\uBA54\uC778 \uAC1C\uB150\uACFC \uAC1C\uB150 \uC0AC\uC774\uC758 \uAD00\uACC4\uB97C \uB300\uB7B5\uC801\uC73C\uB85C \uD45C\uD604\uD55C \uAC83\uC774\uB2E4. \uC124\uACC4\uB97C \uC2DC\uC791\uD558\uB294 \uB2E8\uACC4\uC5D0\uC11C\uB294 \uAC1C\uB150\uB4E4\uC758 \uC758\uBBF8\uC640 \uAD00\uACC4\uAC00 \uC815\uD655\uD558\uAC70\uB098 \uC644\uBCBD\uD560 \uD544\uC694\uAC00 \uC5C6\uB2E4.</p><p>\uC774 \uB2E8\uACC4\uC5D0\uC11C\uB294 \uCC45\uC784\uC744 \uD560\uB2F9\uBC1B\uC744 \uAC1D\uCCB4\uB4E4\uC758 \uC885\uB958\uC640 \uAD00\uACC4\uC5D0 \uB300\uD55C \uC720\uC6A9\uD55C \uC815\uBCF4\uB97C \uC81C\uACF5\uD560 \uC218 \uC788\uB2E4\uBA74 \uCDA9\uBD84\uD558\uB2E4. \uC911\uC694\uD55C \uAC83\uC740 \uC124\uACC4\uB97C \uC2DC\uC791\uD558\uB294 \uAC83\uC774\uC9C0 \uB3C4\uBA54\uC778 \uAC1C\uB150\uB4E4\uC744 \uC644\uBCBD\uD558\uAC8C \uC815\uB9AC\uD558\uB294 \uAC83\uC774 \uC544\uB2C8\uB2E4.</p><h3 id="\u110C\u1165\u11BC\u1107\u1169-\u110C\u1165\u11AB\u1106\u116E\u11AB\u1100\u1161\u110B\u1166\u1100\u1166-\u110E\u1162\u11A8\u110B\u1175\u11B7\u110B\u1173\u11AF-\u1112\u1161\u11AF\u1103\u1161\u11BC\u1112\u1161\u1105\u1161" tabindex="-1"><a class="header-anchor" href="#\u110C\u1165\u11BC\u1107\u1169-\u110C\u1165\u11AB\u1106\u116E\u11AB\u1100\u1161\u110B\u1166\u1100\u1166-\u110E\u1162\u11A8\u110B\u1175\u11B7\u110B\u1173\u11AF-\u1112\u1161\u11AF\u1103\u1161\u11BC\u1112\u1161\u1105\u1161" aria-hidden="true">#</a> \uC815\uBCF4 \uC804\uBB38\uAC00\uC5D0\uAC8C \uCC45\uC784\uC744 \uD560\uB2F9\uD558\uB77C</h3><p>\uCC45\uC784 \uC8FC\uB3C4 \uC124\uACC4 \uBC29\uC2DD\uC758 \uCCAB \uB2E8\uACC4\uB294 \uC560\uD50C\uB9AC\uCF00\uC774\uC158\uC774 \uC81C\uACF5\uD574\uC57C \uD558\uB294 \uAE30\uB2A5\uC744 \uC560\uD50C\uB9AC\uCF00\uC774\uC158\uC758 \uCC45\uC784\uC73C\uB85C \uC0DD\uAC01\uD558\uB294 \uAC83\uC774\uB2E4. \uC774 \uCC45\uC784\uC744 \uC560\uD50C\uB9AC\uCF00\uC774\uC158\uC5D0 \uB300\uD574 \uC804\uC1A1\uB41C \uBA54\uC2DC\uC9C0\uB85C \uAC04\uC8FC\uD558\uACE0 \uC774 \uBA54\uC2DC\uC9C0\uB97C \uCC45\uC784\uC9C8 \uCCAB \uBC88\uC9F8 \uAC1D\uCCB4\uB97C \uC120\uD0DD\uD558\uB294 \uAC83\uC73C\uB85C \uC124\uACC4\uB97C \uC2DC\uC791\uD55C\uB2E4.</p><p>\uBA54\uC2DC\uC9C0\uB294 \uBA54\uC2DC\uC9C0\uB97C \uC218\uC2E0\uD560 \uAC1D\uCCB4\uAC00 \uC544\uB2C8\uB77C \uBA54\uC2DC\uC9C0\uB97C \uC804\uC1A1\uD560 \uAC1D\uCCB4\uC758 \uC758\uB3C4\uB97C \uBC18\uC601\uD574\uC11C \uACB0\uC815\uD574\uC57C \uD55C\uB2E4.</p><p>\uB530\uB77C\uC11C \uB2E4\uC74C \uB450 \uC9C8\uBB38\uC5D0 \uC9D1\uC911\uD558\uBA74 \uB41C\uB2E4.</p><ol><li>\uBA54\uC2DC\uC9C0\uB97C \uC804\uC1A1\uD560 \uAC1D\uCCB4\uB294 \uBB34\uC5C7\uC744 \uC6D0\uD558\uB294\uAC00?</li><li>\uBA54\uC2DC\uC9C0\uB97C \uC218\uC2E0\uD560 \uC801\uD569\uD55C \uAC1D\uCCB4\uB294 \uB204\uAD6C\uC778\uAC00?</li></ol><p>\uAC1D\uCCB4\uC758 \uCC45\uC784\uACFC \uCC45\uC784\uC744 \uC218\uD589\uD558\uB294 \uB370 \uD544\uC694\uD55C \uC0C1\uD0DC\uB294 \uB3D9\uC77C\uD55C \uAC1D\uCCB4 \uC548\uC5D0 \uC874\uC7AC\uD574\uC57C \uD55C\uB2E4. \uB530\uB77C\uC11C \uAC1D\uCCB4\uC5D0\uAC8C \uCC45\uC784\uC744 \uD560\uB2F9\uD558\uB294 \uCCAB \uBC88\uC9F8 \uC6D0\uCE59\uC740 <strong>\uCC45\uC784\uC744 \uC218\uD589\uD560 \uC815\uBCF4\uB97C \uC54C\uACE0 \uC788\uB294 \uAC1D\uCCB4\uC5D0\uAC8C \uCC45\uC784\uC744 \uD560\uB2F9\uD558\uB294 \uAC83\uC774\uB2E4.</strong></p><p>GRASP\uC5D0\uC11C\uB294 \uC774\uB97C <strong>INFORMATION EXPERT(\uC815\uBCF4 \uC804\uBB38\uAC00)</strong> \uD328\uD134\uC774\uB77C\uACE0 \uBD80\uB978\uB2E4.</p><p>\uC5EC\uAE30\uC11C \uC774\uC57C\uAE30\uD558\uB294 \uC815\uBCF4\uB294 \uB370\uC774\uD130\uC640 \uB2E4\uB974\uB2E4\uB294 \uC0AC\uC2E4\uC5D0 \uC8FC\uC758\uD558\uB77C. \uCC45\uC784\uC744 \uC218\uD589\uD558\uB294 \uAC1D\uCCB4\uAC00 \uC815\uBCF4\uB97C &#39;\uC54C\uACE0&#39; \uC788\uB2E4\uACE0 \uD574\uC11C \uADF8 \uC815\uBCF4\uB97C &#39;\uC800\uC7A5&#39;\uD558\uACE0 \uC788\uC744 \uD544\uC694\uB294 \uC5C6\uB2E4.</p><p>\uC5B4\uB5A4 \uBC29\uC2DD\uC774\uAC74 \uC815\uBCF4 \uC804\uBB38\uAC00\uAC00 \uB370\uC774\uD130\uB97C \uBC18\uB4DC\uC2DC \uC800\uC7A5\uD558\uACE0 \uC788\uC744 \uD544\uC694\uB294 \uC5C6\uB2E4\uB294 \uC0AC\uC2E4\uC744 \uC774\uD574\uD558\uB294 \uAC83\uC774 \uC911\uC694\uD558\uB2E4.</p><p><img src="'+p+'" alt="2"></p><p>\uC704\uC758 \uADF8\uB9BC\uC5D0\uC11C Screening(\uC0C1\uC601)\uC740 \uC601\uD654 \uC608\uB9E4\uB97C \uC704\uD55C \uC815\uBCF4 \uC804\uBB38\uAC00\uB2E4. \uADF8\uB798\uC11C \uC608\uB9E4\uC5D0 \uAD00\uD55C \uCC45\uC784\uC744 \uD560\uB2F9\uBC1B\uC558\uC9C0\uB9CC, \uAC00\uACA9\uC744 \uACC4\uC0B0\uD558\uB294\uAC83\uC740 \uBABB\uD558\uAE30\uC5D0 \uC678\uBD80\uC758 Movie\uC5D0\uAC8C \uB3C4\uC6C0\uC744 \uC694\uCCAD\uD558\uC5EC Movie\uAC00 \uAC00\uACA9\uACC4\uC0B0\uC758 \uCC45\uC784\uC744 \uC9C0\uAC8C \uB41C\uB2E4. \uD560\uC778 \uC5EC\uBD80\uB3C4 \uB9C8\uCC2C\uAC00\uC9C0\uB85C \uC678\uBD80\uC758 DiscountCondition\uC5D0\uAC8C \uCC45\uC784\uC744 \uC9C0\uAC8C \uD558\uBA74 \uB41C\uB2E4.</p><p>\uC704\uC758 \uC608\uC81C\uCC98\uB7FC \uC815\uBCF4 \uC804\uBB38\uAC00 \uD328\uD134\uC740 \uC0C1\uD0DC\uC640 \uD589\uB3D9\uC744 \uD568\uAED8 \uAC00\uC9C0\uB294 \uB2E8\uC704\uB77C\uB294 \uAC1D\uCCB4\uC9C0\uD5A5\uC758 \uAC00\uC7A5 \uAE30\uBCF8\uC801\uC778\uC6D0\uB9AC\uB97C \uCC45\uC784 \uD560\uB2F9\uC758 \uAD00\uC810\uC5D0\uC11C \uD45C\uD604\uD55C\uB2E4.</p><p>\uC774\uB7F0\uC2DD\uC73C\uB85C \uC815\uBCF4 \uC804\uBB38\uAC00 \uD328\uD134\uC744 \uB530\uB974\uB294\uAC83\uB9CC\uC73C\uB85C\uB3C4 \uC790\uC728\uC131\uC774 \uB192\uC740 \uAC1D\uCCB4\uB4E4\uB3C4 \uAD6C\uC131\uB41C \uD611\uB825 \uACF5\uB3D9\uCCB4\uB97C \uAD6C\uCD95\uD560 \uAC00\uB2A5\uC131\uC774 \uB192\uC544\uC9C0\uB294 \uAC83\uC774\uB2E4.</p><h3 id="\u1102\u1169\u11C1\u110B\u1173\u11AB-\u110B\u1173\u11BC\u110C\u1175\u11B8\u1103\u1169\u110B\u116A-\u1102\u1161\u11BD\u110B\u1173\u11AB-\u1100\u1167\u11AF\u1112\u1161\u11B8\u1103\u1169" tabindex="-1"><a class="header-anchor" href="#\u1102\u1169\u11C1\u110B\u1173\u11AB-\u110B\u1173\u11BC\u110C\u1175\u11B8\u1103\u1169\u110B\u116A-\u1102\u1161\u11BD\u110B\u1173\u11AB-\u1100\u1167\u11AF\u1112\u1161\u11B8\u1103\u1169" aria-hidden="true">#</a> \uB192\uC740 \uC751\uC9D1\uB3C4\uC640 \uB0AE\uC740 \uACB0\uD569\uB3C4</h3><p>\uC704\uC758 \uC124\uACC4\uC5D0\uC11C Movie \uB300\uC2E0 Screening\uC774 \uC9C1\uC811 DiscountCondition\uACFC \uD611\uB825\uD558\uAC8C \uD574\uBCF4\uC790.</p><p><img src="'+o+'" alt="3"></p><p>\uC774\uC804 \uC124\uACC4\uC640\uC758 \uCC28\uC774\uC810\uC774\uB77C\uBA74 DiscountCondition\uACFC \uD611\uB825\uD558\uB294 \uAC1D\uCCB4\uAC00 Movie\uAC00 \uC544\uB2C8\uB77C Screening\uC774\uB77C\uB294 \uAC83 \uBFD0\uC774\uB2E4.</p><p>\uD558\uC9C0\uB9CC \uC774 \uC124\uACC4\uB97C \uC120\uD0DD\uD558\uC9C0 \uC54A\uACE0 \uC774\uC804\uC758 \uC124\uACC4\uB97C \uC120\uD0DD\uD558\uB294 \uC774\uC720\uB294 \uC751\uC9D1\uB3C4\uC640 \uACB0\uD569\uB3C4\uC758 \uCC28\uC774 \uB54C\uBB38\uC774\uB2E4.</p><p>\uB3C4\uBA54\uC778 \uC0C1\uC73C\uB85C Movie\uB294 DiscountCondition\uC758 \uBAA9\uB85D\uC744 \uC18D\uC131\uC73C\uB85C \uD3EC\uD568\uD558\uACE0 \uC788\uB2E4. \uADF8\uB807\uB2E4\uB294\uAC83\uC740 Movie\uC640 DiscountCondition\uC740 \uC774\uBBF8 \uACB0\uD569\uB418\uC5B4 \uC788\uB2E4\uB294\uAC83\uC778\uB370, Screening\uC774 DiscountCondition\uACFC \uD611\uB825\uD558\uAC8C \uB418\uBA74 \uC0C8\uB85C\uC6B4 \uACB0\uD569\uB3C4\uAC00 \uCD94\uAC00\uB418\uB294 \uACB0\uACFC\uAC00 \uB098\uC624\uAC8C \uB41C\uB2E4.</p><p>\uADF8\uB798\uC11C \uC774\uC804 \uC124\uACC4\uCC98\uB7FC Movie\uC640 DiscountCondition\uC774 \uD611\uB825\uD558\uAC8C \uD558\uBA74 \uB0AE\uC740 \uACB0\uD569\uB3C4(LOW COUPLING)\uC744 \uC720\uC9C0\uD560 \uC218\uAC00 \uC788\uB2E4. GRASP\uC5D0\uC11C\uB294 \uC774\uB97C **LOW COUPLING(\uB0AE\uC740 \uACB0\uD569\uB3C4)**\uB77C\uACE0 \uBD80\uB978\uB2E4.</p><p><strong>HIGH COHESION(\uB192\uC740 \uC751\uC9D1\uB3C4)</strong> \uD328\uD134 \uB610\uD55C \uC874\uC7AC\uD55C\uB2E4.</p><p>HIGH COHESION \uD328\uD134\uC758 \uAD00\uC810\uC5D0\uC11C \uBCF8\uB2E4\uBA74, \uC704\uC758 \uC124\uACC4\uB294 \uC608\uB9E4 \uC694\uAE08\uC744 \uACC4\uC0B0\uD558\uB294 \uBC29\uC2DD\uC774 \uBCC0\uACBD\uB420 \uACBD\uC6B0 Screening\uB3C4 \uD568\uAED8 \uBCC0\uACBD\uD574\uC57C \uD55C\uB2E4. \uACB0\uACFC\uC801\uC73C\uB85C Screening\uC740 \uC790\uAE30\uAC00 \uC6D0\uB798 \uC9CA\uC5B4\uC9C0\uB358 \uCC45\uC784\uACFC\uB294 \uB2E4\uB978 \uC774\uC720\uB85C \uBCC0\uACBD\uB418\uB294 \uCC45\uC784\uC744 \uC9CA\uC5B4\uC9C0\uAC8C \uB418\uBBC0\uB85C \uC751\uC9D1\uB3C4\uAC00 \uB0AE\uC544\uC9C8 \uC218 \uBC16\uC5D0 \uC5C6\uB2E4.</p><h3 id="\u110E\u1161\u11BC\u110C\u1169\u110C\u1161\u110B\u1166\u1100\u1166-\u1100\u1162\u11A8\u110E\u1166-\u1109\u1162\u11BC\u1109\u1165\u11BC-\u110E\u1162\u11A8\u110B\u1175\u11B7\u110B\u1173\u11AF-\u1112\u1161\u11AF\u1103\u1161\u11BC\u1112\u1161\u1105\u1161" tabindex="-1"><a class="header-anchor" href="#\u110E\u1161\u11BC\u110C\u1169\u110C\u1161\u110B\u1166\u1100\u1166-\u1100\u1162\u11A8\u110E\u1166-\u1109\u1162\u11BC\u1109\u1165\u11BC-\u110E\u1162\u11A8\u110B\u1175\u11B7\u110B\u1173\u11AF-\u1112\u1161\u11AF\u1103\u1161\u11BC\u1112\u1161\u1105\u1161" aria-hidden="true">#</a> \uCC3D\uC870\uC790\uC5D0\uAC8C \uAC1D\uCCB4 \uC0DD\uC131 \uCC45\uC784\uC744 \uD560\uB2F9\uD558\uB77C</h3><p>GRASP\uC758 CREATOR(\uCC3D\uC870\uC790) \uD328\uD134\uC740 \uC774 \uAC19\uC740 \uACBD\uC6B0\uC5D0 \uC0AC\uC6A9\uD560 \uC218 \uC788\uB294 \uCC45\uC784 \uD560\uB2F9 \uD328\uD134\uC73C\uB85C\uC11C \uAC1D\uCCB4\uB97C \uC0DD\uC131\uD560 \uCC45\uC784\uC744 \uC5B4\uB5A4 \uAC1D\uCCB4\uC5D0\uAC8C \uD560\uB2F9\uD560\uC9C0\uC5D0 \uB300\uD55C \uC9C0\uCE68\uC744 \uC81C\uACF5\uD55C\uB2E4.</p><ul><li>\uD574\uB2F9 \uAC1D\uCCB4\uAC00 \uB9CC\uB4E4 \uAC1D\uCCB4\uB97C \uD3EC\uD568\uD558\uAC70\uB098 \uCC38\uC870\uD55C\uB2E4.</li><li>\uD574\uB2F9 \uAC1D\uCCB4\uAC00 \uB9CC\uB4E4 \uAC1D\uCCB4\uB97C \uAE30\uB85D\uD55C\uB2E4.</li><li>\uD574\uB2F9 \uAC1D\uCCB4\uAC00 \uB9CC\uB4E4 \uAC1D\uCCB4\uB97C \uAE34\uBC00\uD558\uAC8C \uC0AC\uC6A9\uD55C\uB2E4.</li><li>\uD574\uB2F9 \uAC1D\uCCB4\uAC00 \uB9CC\uB4E4 \uAC1D\uCCB4\uB97C \uCD08\uAE30\uD654\uD558\uB294 \uB370 \uD544\uC694\uD55C \uB370\uC774\uD130\uB97C \uAC00\uC9C0\uACE0 \uC788\uB2E4.(\uC815\uBCF4 \uC804\uBB38\uAC00 \uD328\uD134)</li></ul><p>\uC704\uC758 \uC870\uAC74\uC744 \uCD5C\uB300\uD55C \uB9CC\uC871\uD558\uB294 \uAC1D\uCCB4\uC5D0\uAC8C \uAC1D\uCCB4 \uC0DD\uC131 \uCC45\uC784\uC744 \uD560\uB2F9\uD558\uBA74 \uB41C\uB2E4.</p><p><img src="'+i+`" alt="4"></p><h2 id="_3-\u1100\u116E\u1112\u1167\u11AB\u110B\u1173\u11AF-\u1110\u1169\u11BC\u1112\u1161\u11AB-\u1100\u1165\u11B7\u110C\u1173\u11BC" tabindex="-1"><a class="header-anchor" href="#_3-\u1100\u116E\u1112\u1167\u11AB\u110B\u1173\u11AF-\u1110\u1169\u11BC\u1112\u1161\u11AB-\u1100\u1165\u11B7\u110C\u1173\u11BC" aria-hidden="true">#</a> 3. \uAD6C\uD604\uC744 \uD1B5\uD55C \uAC80\uC99D</h2><ul><li>Screening</li></ul><div class="language-java ext-java line-numbers-mode"><pre class="language-java"><code><span class="token keyword">public</span> <span class="token keyword">class</span> <span class="token class-name">Screening</span> <span class="token punctuation">{</span>
	<span class="token keyword">private</span> <span class="token class-name">Movie</span> movie<span class="token punctuation">;</span>
	<span class="token keyword">private</span> <span class="token keyword">int</span> sequence<span class="token punctuation">;</span>
	<span class="token keyword">private</span> <span class="token class-name">LocalDateTime</span> whenScreened<span class="token punctuation">;</span>

	<span class="token keyword">public</span> <span class="token class-name">Reservation</span> <span class="token class-name">Reserve</span><span class="token punctuation">(</span><span class="token class-name">Customer</span> customer<span class="token punctuation">,</span> <span class="token keyword">int</span> audienceCount<span class="token punctuation">)</span> <span class="token punctuation">{</span>
		<span class="token keyword">return</span> <span class="token keyword">new</span> <span class="token class-name">Reservation</span><span class="token punctuation">(</span>customer<span class="token punctuation">,</span> <span class="token keyword">this</span><span class="token punctuation">,</span> <span class="token function">calculateFee</span><span class="token punctuation">(</span>audienceCount<span class="token punctuation">)</span><span class="token punctuation">,</span> audienceCount<span class="token punctuation">)</span><span class="token punctuation">;</span>
	<span class="token punctuation">}</span>

	<span class="token keyword">private</span> <span class="token class-name">Money</span> <span class="token function">calculateFee</span><span class="token punctuation">(</span><span class="token keyword">int</span> audienceCount<span class="token punctuation">)</span> <span class="token punctuation">{</span>
		<span class="token keyword">return</span> movie<span class="token punctuation">.</span><span class="token function">calculateMovieFee</span><span class="token punctuation">(</span><span class="token keyword">this</span><span class="token punctuation">)</span><span class="token punctuation">.</span><span class="token function">times</span><span class="token punctuation">(</span>audienceCount<span class="token punctuation">)</span><span class="token punctuation">;</span>
	<span class="token punctuation">}</span>
<span class="token punctuation">}</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>Movie\uC5D0 \uC804\uC1A1\uD558\uB294 \uBA54\uC2DC\uC9C0\uC758 \uC2DC\uADF8\uB2C8\uCC98\uC778 calculateMovieFee(Screening screening)\uC744 \uBCF4\uC790.</p><p>\uC774 \uBA54\uC2DC\uC9C0\uB294 \uC218\uC2E0\uC790\uC778 Movie\uAC00 \uC544\uB2C8\uB77C \uC1A1\uC2E0\uC790\uC778 Screening\uC758 \uAD00\uC810\uC5D0\uC11C \uC758\uB3C4\uB97C \uD45C\uD604\uD55C\uB2E4.</p><p>\uC774\uCC98\uB7FC Movie\uC758 \uAD6C\uD604\uC744 \uACE0\uB824\uD558\uC9C0 \uC54A\uACE0 \uD544\uC694\uD55C \uBA54\uC2DC\uC9C0\uB97C \uACB0\uC815\uD558\uBA74 Movie\uC758 \uB0B4\uBD80 \uAD6C\uD604\uC744 \uAE54\uB054\uD558\uAC8C \uCEA1\uC290\uD654\uD560 \uC218 \uC788\uB2E4.</p><h3 id="\u1107\u1167\u11AB\u1100\u1167\u11BC\u110B\u1166-\u110E\u1171\u110B\u1163\u11A8\u1112\u1161\u11AB-\u110F\u1173\u11AF\u1105\u1162\u1109\u1173-\u1100\u1162\u1109\u1165\u11AB\u1112\u1161\u1100\u1175" tabindex="-1"><a class="header-anchor" href="#\u1107\u1167\u11AB\u1100\u1167\u11BC\u110B\u1166-\u110E\u1171\u110B\u1163\u11A8\u1112\u1161\u11AB-\u110F\u1173\u11AF\u1105\u1162\u1109\u1173-\u1100\u1162\u1109\u1165\u11AB\u1112\u1161\u1100\u1175" aria-hidden="true">#</a> \uBCC0\uACBD\uC5D0 \uCDE8\uC57D\uD55C \uD074\uB798\uC2A4 \uAC1C\uC120\uD558\uAE30</h3><p>\uC751\uC9D1\uB3C4\uAC00 \uB0AE\uB2E4\uB294 \uAC83\uC740 \uC11C\uB85C \uC5F0\uAD00\uC131\uC774 \uC5C6\uB294 \uAE30\uB2A5\uC774\uB098 \uAC8C\uC774\uD130\uAC00 \uD558\uB098\uC758 \uD074\uB798\uC2A4 \uC548\uC5D0 \uBB49\uCCD0\uC838 \uC788\uB2E4\uB294 \uAC83\uC744 \uC758\uBBF8\uD55C\uB2E4. \uB530\uB77C\uC11C \uB0AE\uC740 \uC751\uC9D1\uB3C4\uAC00 \uCD08\uB798\uD558\uB294 \uBB38\uC81C\uB97C \uD574\uACB0\uD558\uAE30 \uC704\uD574\uC11C\uB294 <strong>\uBCC0\uACBD\uC758 \uC774\uC720\uC5D0 \uB530\uB77C \uD074\uB798\uC2A4\uB97C \uBD84\uB9AC\uD574\uC57C \uD55C\uB2E4.</strong></p><p>\uC9C0\uAE08\uAE4C\uC9C0 \uC0B4\uD3B4\uBCF8 \uAC83\uCC98\uB7FC \uC77C\uBC18\uC801\uC73C\uB85C \uC124\uACC4\uB97C \uAC1C\uC120\uD558\uB294 \uC791\uC5C5\uC740 \uBCC0\uACBD\uC758 \uC774\uC720\uAC00 \uD558\uB098 \uC774\uC0C1\uC778 \uD074\uB798\uC2A4\uB97C \uCC3E\uB294 \uAC83\uC73C\uB85C\uBD80\uD130 \uC2DC\uC791\uD558\uB294 \uAC83\uC774 \uC88B\uB2E4.</p><p><strong>\uCCAB \uBC88\uC9F8\uB294</strong> \uC778\uC2A4\uD134\uC2A4 \uBCC0\uC218\uAC00 \uCD08\uAE30\uD654\uB418\uB294 \uC2DC\uC810\uC744 \uC0B4\uD3B4\uBCF4\uB294 \uAC83\uC774\uB2E4. \uC751\uC9D1\uB3C4\uAC00 \uB192\uC740 \uD074\uB798\uC2A4\uB294 \uC778\uC2A4\uD134\uC2A4\uB97C \uC0DD\uC131\uD560 \uB54C \uBAA8\uB4E0 \uC18D\uC131\uC744 \uD568\uAED8 \uCD08\uAE30\uD654\uD558\uC9C0\uB9CC, \uC751\uC9D1\uB3C4\uAC00 \uB0AE\uC740 \uD074\uB798\uC2A4\uB294 \uAC1D\uCCB4\uC758 \uC18D\uC131 \uC911 \uC77C\uBD80\uB9CC \uCD08\uAE30\uD654\uD55C\uB2E4. \uB530\uB77C\uC11C <strong>\uD568\uAED8 \uCD08\uAE30\uD654\uB418\uB294 \uC18D\uC131\uC744 \uAE30\uC900\uC73C\uB85C \uCF54\uB4DC\uB97C \uBD84\uB9AC\uD574\uC57C \uD55C\uB2E4.</strong></p><p><strong>\uB450 \uBC88\uC9F8</strong>\uB294 <strong>\uBA54\uC11C\uB4DC\uB4E4\uC774 \uC778\uC2A4\uD134\uC2A4 \uBCC0\uC218\uB97C \uC0AC\uC6A9\uD558\uB294 \uBC29\uC2DD\uC744 \uC0B4\uD3B4\uBCF4\uB294 \uAC83</strong>\uC774\uB2E4.</p><p>\uBAA8\uB4E0 \uBA54\uC11C\uB4DC\uAC00 \uAC1D\uCCB4\uC758 \uBAA8\uB4E0 \uC18D\uC131\uC744 \uC0AC\uC6A9\uD55C\uB2E4\uBA74 \uD074\uB798\uC2A4\uC758 \uC751\uC9D1\uB3C4\uB294 \uB192\uB2E4\uACE0 \uBCFC \uC218 \uC788\uB2E4.</p><p>\uBC18\uBA74 \uBA54\uC11C\uB4DC\uB4E4\uC774 \uC778\uC2A4\uD134\uC2A4 \uBCC0\uC218\uB97C \uC0AC\uC6A9\uD558\uB294 \uC18D\uC131\uC5D0 \uB530\uB77C \uADF8\uB8F9\uC774 \uB098\uB25C\uB2E4\uBA74 \uD074\uB798\uC2A4\uC758 \uC751\uC9D1\uB3C4\uAC00 \uB0AE\uB2E4\uACE0 \uBCFC \uC218 \uC788\uB2E4.</p><p>\uC774 \uACBD\uC6B0 \uD074\uB798\uC2A4\uC758 \uC751\uC9D1\uB3C4\uB97C \uB192\uC774\uAE30 \uC704\uD574\uC11C\uB294 \uC18D\uC131 \uADF8\uB8F9\uACFC \uD574\uB2F9 \uADF8\uB8F9\uC5D0 \uC811\uADFC\uD558\uB294 \uBA54\uC11C\uB4DC \uADF8\uB8F9\uC744 \uAE30\uC900\uC73C\uB85C \uCF54\uB4DC\uB97C \uBD84\uB9AC\uD574\uC57C \uD55C\uB2E4.</p><p>\uC815\uB9AC\uD558\uC790\uBA74 \uB2E4\uC74C\uACFC \uAC19\uB2E4.</p><ol><li>\uD074\uB798\uC2A4\uAC00 \uD558\uB098 \uC774\uC0C1\uC758 \uC774\uC720\uB85C \uBCC0\uACBD\uB41C\uB2E4\uBA74, \uBCC0\uACBD\uC758 \uC774\uC720\uB97C \uAE30\uC900\uC73C\uB85C \uD074\uB798\uC2A4\uB97C \uBD84\uB9AC\uD558\uB77C.</li><li>\uD074\uB798\uC2A4\uC758 \uC778\uC2A4\uD134\uC2A4\uB97C \uCD08\uAE30\uD654\uD558\uB294 \uC2DC\uC810\uC5D0 \uACBD\uC6B0\uC5D0 \uB530\uB77C \uC11C\uB85C \uB2E4\uB978 \uC18D\uC131\uB4E4\uC744 \uCD08\uAE30\uD654 \uD558\uACE0 \uC788\uB2E4\uBA74, \uCD08\uAE30\uD654\uB418\uB294 \uC18D\uC131\uC758 \uADF8\uB8F9\uC744 \uAE30\uC900\uC73C\uB85C \uD074\uB798\uC2A4\uB97C \uBD84\uB9AC\uD558\uB77C.</li><li>\uBA54\uC11C\uB4DC \uADF8\uB8F9\uC774 \uC18D\uC131 \uADF8\uB8F9\uC744 \uC0AC\uC6A9\uD558\uB294\uC9C0 \uC5EC\uBD80\uB85C \uB098\uB25C\uB2E4\uBA74, \uC18D\uC131 \uADF8\uB8F9\uC744 \uAE30\uC900\uC73C\uB85C \uD074\uB798\uC2A4\uB97C \uBD84\uB9AC\uD558\uB77C.</li></ol><h3 id="\u1110\u1161\u110B\u1175\u11B8-\u1107\u116E\u11AB\u1105\u1175\u1112\u1161\u1100\u1175" tabindex="-1"><a class="header-anchor" href="#\u1110\u1161\u110B\u1175\u11B8-\u1107\u116E\u11AB\u1105\u1175\u1112\u1161\u1100\u1175" aria-hidden="true">#</a> \uD0C0\uC785 \uBD84\uB9AC\uD558\uAE30</h3><div class="language-java ext-java line-numbers-mode"><pre class="language-java"><code><span class="token keyword">public</span> <span class="token keyword">class</span> <span class="token class-name">DiscountCondition</span> <span class="token punctuation">{</span>
    <span class="token keyword">private</span> <span class="token class-name">DiscountConditionType</span> type<span class="token punctuation">;</span>
    <span class="token keyword">private</span> <span class="token keyword">int</span> sequence<span class="token punctuation">;</span>
    <span class="token keyword">private</span> <span class="token class-name">DayOfWeek</span> dayOfWeek<span class="token punctuation">;</span>
    <span class="token keyword">private</span> <span class="token class-name">LocalTime</span> startTime<span class="token punctuation">;</span>
    <span class="token keyword">private</span> <span class="token class-name">LocalTime</span> endTime<span class="token punctuation">;</span>

    <span class="token keyword">public</span> <span class="token keyword">boolean</span> <span class="token function">isSatisfiedBy</span><span class="token punctuation">(</span><span class="token class-name">Screening</span> screening<span class="token punctuation">)</span> <span class="token punctuation">{</span>
        <span class="token keyword">if</span> <span class="token punctuation">(</span>type <span class="token operator">==</span> <span class="token class-name">DiscountConditionType</span><span class="token punctuation">.</span>PERIOD<span class="token punctuation">)</span> <span class="token punctuation">{</span>
            <span class="token keyword">return</span> <span class="token function">isSatisfiedByPeriod</span><span class="token punctuation">(</span>screening<span class="token punctuation">)</span><span class="token punctuation">;</span>
        <span class="token punctuation">}</span>

        <span class="token keyword">return</span> <span class="token function">isSatisfiedBySequence</span><span class="token punctuation">(</span>screening<span class="token punctuation">)</span><span class="token punctuation">;</span>
    <span class="token punctuation">}</span>

    <span class="token keyword">private</span> <span class="token keyword">boolean</span> <span class="token function">isSatisfiedByPeriod</span><span class="token punctuation">(</span><span class="token class-name">Screening</span> screening<span class="token punctuation">)</span> <span class="token punctuation">{</span>
        <span class="token keyword">return</span> dayOfWeek<span class="token punctuation">.</span><span class="token function">equals</span><span class="token punctuation">(</span>screening<span class="token punctuation">.</span><span class="token function">getWhenScreened</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">.</span><span class="token function">getDayOfWeek</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">)</span> <span class="token operator">&amp;&amp;</span>
                startTime<span class="token punctuation">.</span><span class="token function">compareTo</span><span class="token punctuation">(</span>screening<span class="token punctuation">.</span><span class="token function">getWhenScreened</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">.</span><span class="token function">toLocalTime</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">)</span> <span class="token operator">&lt;=</span> <span class="token number">0</span> <span class="token operator">&amp;&amp;</span>
                endTime<span class="token punctuation">.</span><span class="token function">compareTo</span><span class="token punctuation">(</span>screening<span class="token punctuation">.</span><span class="token function">getWhenScreened</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">.</span><span class="token function">toLocalTime</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">)</span> <span class="token operator">&lt;=</span> <span class="token number">0</span><span class="token punctuation">;</span>
    <span class="token punctuation">}</span>

    <span class="token keyword">private</span> <span class="token keyword">boolean</span> <span class="token function">isSatisfiedBySequence</span><span class="token punctuation">(</span><span class="token class-name">Screening</span> screening<span class="token punctuation">)</span> <span class="token punctuation">{</span>
        <span class="token keyword">return</span> sequence <span class="token operator">==</span> screening<span class="token punctuation">.</span><span class="token function">getSequence</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
    <span class="token punctuation">}</span>
<span class="token punctuation">}</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>DiscountCondition\uC740 sequence, period\uB77C\uB294 \uB3C5\uB9BD\uC801\uC778 \uD0C0\uC785\uC774 \uACF5\uC874\uD558\uACE0 \uC788\uB2E4.</p><p>\uC774\uB7F0 \uACBD\uC6B0\uC5D0 \uD074\uB798\uC2A4\uB97C \uD0C0\uC785\uBCC4\uB85C \uBD84\uB9AC\uD574\uC8FC\uBA74(SequenceCondition, PeriodCondition) \uBB38\uC81C\uC810\uC774 \uD574\uACB0\uB418\uC9C0\uB9CC, Movie\uAC00 \uB450\uAC1C\uC758 \uD074\uB798\uC2A4\uC640 \uACB0\uD569\uB418\uAC8C \uB418\uC5B4\uBC84\uB9B0\uB2E4. \uC774 \uBB38\uC81C\uB294 \uB2E4\uD615\uC131\uC744 \uD1B5\uD574 \uD574\uACB0\uD560 \uC218 \uC788\uB2E4.</p><h3 id="\u1103\u1161\u1112\u1167\u11BC\u1109\u1165\u11BC\u110B\u1173\u11AF-\u1110\u1169\u11BC\u1112\u1162-\u1107\u116E\u11AB\u1105\u1175\u1112\u1161\u1100\u1175" tabindex="-1"><a class="header-anchor" href="#\u1103\u1161\u1112\u1167\u11BC\u1109\u1165\u11BC\u110B\u1173\u11AF-\u1110\u1169\u11BC\u1112\u1162-\u1107\u116E\u11AB\u1105\u1175\u1112\u1161\u1100\u1175" aria-hidden="true">#</a> \uB2E4\uD615\uC131\uC744 \uD1B5\uD574 \uBD84\uB9AC\uD558\uAE30</h3><p>Movie\uC758 \uC785\uC7A5\uC5D0\uC11C \uBCF4\uBA74 SequenceCondition\uACFC PeriodCondition\uC740 \uC544\uBB34 \uCC28\uC774\uB3C4 \uC5C6\uB2E4.</p><p>\uD560\uC778 \uAC00\uB2A5 \uC5EC\uBD80\uB97C \uBC18\uD658\uD574 \uC8FC\uAE30\uB9CC \uD558\uBA74 Movie \uC785\uC7A5\uC5D0\uC11C\uB294 \uC0C1\uAD00\uC5C6\uAE30 \uB54C\uBB38\uC774\uB2E4.</p><p>\uB530\uB77C\uC11C DiscountCondition\uC744 \uC554\uC2DC\uC801\uC778 \uD0C0\uC785\uC73C\uB85C \uB2E4\uC2DC \uB9CC\uB4E4\uC5B4\uC8FC\uACE0 \uBCC0\uD654\uD558\uB294 \uD589\uB3D9\uC5D0 \uB530\uB77C \uBD84\uB9AC\uD55C \uD0C0\uC785\uC5D0 \uCC45\uC784\uC744 \uD560\uB2F9\uD574\uC8FC\uBA74 \uB41C\uB2E4. GRASP\uC5D0\uC11C\uB294 \uC774\uB97C <strong>POLYMORPHISM(\uB2E4\uD615\uC131)</strong> \uD328\uD134\uC774\uB77C\uACE0 \uBD80\uB978\uB2E4.</p><p><img src="`+c+'" alt="5"></p><h3 id="\u1107\u1167\u11AB\u1100\u1167\u11BC\u110B\u1173\u1105\u1169\u1107\u116E\u1110\u1165-\u1107\u1169\u1112\u1169\u1112\u1161\u1100\u1175" tabindex="-1"><a class="header-anchor" href="#\u1107\u1167\u11AB\u1100\u1167\u11BC\u110B\u1173\u1105\u1169\u1107\u116E\u1110\u1165-\u1107\u1169\u1112\u1169\u1112\u1161\u1100\u1175" aria-hidden="true">#</a> \uBCC0\uACBD\uC73C\uB85C\uBD80\uD130 \uBCF4\uD638\uD558\uAE30</h3><p>\uC704\uC758 \uADF8\uB9BC\uC744 \uBCF4\uBA74 DiscountCondition\uC774 \uAD6C\uCCB4\uC801\uC778 \uD0C0\uC785\uC744 \uCEA1\uC290\uD654\uD558\uACE0 \uC788\uB2E4.</p><p>Movie\uC758 \uAD00\uC810\uC5D0\uC11C \uBCF4\uBA74, DiscountCondition\uC758 \uB0B4\uBD80\uB97C \uC54C \uC218 \uC5C6\uAE30 \uB54C\uBB38\uC5D0 DiscountCondition\uC758 \uB0B4\uBD80\uAC00 \uBCC0\uD558\uB354\uB77C\uACE0 \uC544\uBB34 \uC601\uD5A5\uC744 \uBC1B\uC9C0 \uC54A\uB294\uB2E4. \uADF8\uB807\uAE30\uC5D0 Movie\uB294 DiscountCondition\uC758 \uBCC0\uACBD\uC73C\uB85C\uBD80\uD130 \uC601\uD5A5\uC744 \uBC1B\uC9C0 \uC54A\uB294\uB2E4.</p><p>\uC774\uCC98\uB7FC \uBCC0\uACBD\uC744 \uCEA1\uC290\uD654\uD558\uB3C4\uB85D \uCC45\uC784\uC744 \uD560\uB2F9\uD558\uB294 \uAC83\uC744 GRASP\uC5D0\uC11C\uB294 <strong>PROTECTED VARIATIONS(\uBCC0\uACBD \uBCF4\uD638)</strong> \uD328\uD134\uC774\uB77C\uACE0 \uBD80\uB978\uB2E4.</p><h3 id="\u1107\u1167\u11AB\u1100\u1167\u11BC\u1100\u116A-\u110B\u1172\u110B\u1167\u11AB\u1109\u1165\u11BC" tabindex="-1"><a class="header-anchor" href="#\u1107\u1167\u11AB\u1100\u1167\u11BC\u1100\u116A-\u110B\u1172\u110B\u1167\u11AB\u1109\u1165\u11BC" aria-hidden="true">#</a> \uBCC0\uACBD\uACFC \uC720\uC5F0\uC131</h3><p>\uC0C1\uC18D\uC744 \uC774\uC6A9\uD560\uB54C \uC0C8\uB85C\uC6B4 \uD560\uC778 \uC815\uCC45\uC774 \uCD94\uAC00\uB41C\uB2E4\uBA74 \uC778\uC2A4\uD134\uC2A4\uB97C \uC0DD\uC131\uD558\uACE0, \uC0C1\uD0DC\uB97C \uBCF5\uC0AC\uD558\uACE0, \uC2DD\uBCC4\uC790\uB97C \uAD00\uB9AC\uD558\uB294 \uCF54\uB4DC\uB97C \uB9E4\uBC88 \uCD94\uAC00\uD574\uC918\uC57C\uD55C\uB2E4. \uC774 \uC77C\uC740 \uBC88\uAC70\uB85C\uC6B8\uBFD0\uB9CC \uC544\uB2C8\uB77C \uC624\uB958\uAC00 \uBC1C\uC0DD\uD558\uAE30\uB3C4 \uC27D\uB2E4.</p><p>\uD574\uACB0 \uBC29\uBC95\uC740 \uC0C1\uC18D \uB300\uC2E0 <strong>\uD569\uC131</strong>\uC744 \uC0AC\uC6A9\uD558\uB294 \uAC83\uC774\uB2E4.</p><p><img src="'+l+'" alt="6"></p><p>\uC704\uC758 \uADF8\uB9BC\uC740 Movie\uB97C \uC0C1\uC18D\uBC1B\uC544 \uD560\uC778 \uC815\uCC45\uC744 \uAD6C\uD604\uD558\uC600\uB2E4. \uC774 \uD560\uC778 \uC815\uCC45\uC744 DiscountPolicy\uB85C \uBD84\uB9AC\uD55C \uD6C4 Movie\uC5D0 \uD569\uC131\uC2DC\uD0A4\uBA74 \uC720\uC5F0\uD55C \uC124\uACC4\uAC00 \uC644\uC131\uB41C\uB2E4.</p><p><img src="'+u+`" alt="7"></p><p>\uC774\uC81C \uAE08\uC561\uD560\uC778\uC5D0\uC11C \uBE44\uC728\uD560\uC778\uC73C\uB85C \uBC14\uAFB8\uB294\uC77C\uC740 Movie\uC5D0 \uC5F0\uACB0\uB41C DiscountPolicy\uC758 \uC778\uC2A4\uD134\uC2A4\uB97C \uAD50\uCCB4\uD558\uB294 \uB2E8\uC21C\uD55C \uC791\uC5C5\uC73C\uB85C \uB05D\uB0BC \uC218 \uC788\uB2E4.</p><div class="language-java ext-java line-numbers-mode"><pre class="language-java"><code><span class="token class-name">Movie</span> movie <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token class-name">Movie</span><span class="token punctuation">(</span><span class="token string">&quot;\uD0C0\uC774\uD0C0\uB2C9&quot;</span><span class="token punctuation">,</span>
												<span class="token class-name">Duration</span><span class="token punctuation">.</span><span class="token function">ofMinutes</span><span class="token punctuation">(</span><span class="token number">120</span><span class="token punctuation">)</span><span class="token punctuation">,</span>
												<span class="token class-name">Money</span><span class="token punctuation">.</span><span class="token function">wons</span><span class="token punctuation">(</span><span class="token number">10000</span><span class="token punctuation">)</span><span class="token punctuation">,</span>
												<span class="token keyword">new</span> <span class="token class-name">AmountDiscountPolicy</span><span class="token punctuation">(</span><span class="token punctuation">.</span><span class="token punctuation">.</span><span class="token punctuation">.</span><span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
movie<span class="token punctuation">.</span><span class="token function">changeDiscountPolicy</span><span class="token punctuation">(</span><span class="token keyword">new</span> <span class="token class-name">PercentDiscountPolicy</span><span class="token punctuation">(</span><span class="token punctuation">.</span><span class="token punctuation">.</span><span class="token punctuation">.</span><span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>\uCF54\uB4DC\uC758 \uAD6C\uC870\uAC00 \uC704\uCC98\uB7FC \uBC14\uB00C\uBA74 \uB3C4\uBA54\uC778 \uAD6C\uC870 \uB610\uD55C \uBC14\uB010\uB2E4.</p><p><img src="`+r+'" alt="8"></p><h2 id="_4-\u110E\u1162\u11A8\u110B\u1175\u11B7-\u110C\u116E\u1103\u1169-\u1109\u1165\u11AF\u1100\u1168\u110B\u1174-\u1103\u1162\u110B\u1161\u11AB" tabindex="-1"><a class="header-anchor" href="#_4-\u110E\u1162\u11A8\u110B\u1175\u11B7-\u110C\u116E\u1103\u1169-\u1109\u1165\u11AF\u1100\u1168\u110B\u1174-\u1103\u1162\u110B\u1161\u11AB" aria-hidden="true">#</a> 4. \uCC45\uC784 \uC8FC\uB3C4 \uC124\uACC4\uC758 \uB300\uC548</h2><p>\uCC45\uC784 \uC8FC\uB3C4 \uC124\uACC4\uC5D0 \uC775\uC219\uD574\uC9C0\uAE30 \uC704\uD574\uC11C\uB294 \uBD80\uB2E8\uD55C \uB178\uB825\uACFC \uC2DC\uAC04\uC774 \uD544\uC694\uD558\uB2E4. \uADF8\uB7EC\uB098 \uC5B4\uB290 \uC815\uB3C4 \uACBD\uD5D8\uC744 \uC313\uC740 \uC219\uB828\uB41C \uC124\uACC4\uC790\uC870\uCC28\uB3C4 \uC801\uC808\uD55C \uCC45\uC784\uACFC \uAC1D\uCCB4\uB97C \uC120\uD0DD\uD558\uB294 \uC77C\uC5D0 \uC5B4\uB824\uC6C0\uC744 \uB290\uB07C\uACE0\uB294 \uD55C\uB2E4.</p><p>\uC774\uB7F4 \uB54C \uAC1C\uC778\uC801\uC73C\uB85C \uB3CC\uD30C\uAD6C\uB97C \uCC3E\uAE30 \uC704\uD574 \uC120\uD0DD\uD558\uB294 \uBC29\uBC95\uC740 \uCD5C\uB300\uD55C \uBE60\uB974\uAC8C \uBAA9\uC801\uD55C \uAE30\uB2A5\uC744 \uC218\uD589\uD558\uB294 \uCF54\uB4DC\uB97C \uC791\uC131\uD558\uB294 \uAC83\uC774\uB2E4. \uCC45\uC784\uACFC \uD611\uB825\uC5D0 \uAD00\uD574 \uACE0\uBBFC\uD558\uAE30 \uBCF4\uB2E4\uB294 \uC77C\uB2E8 \uC2E4\uD589\uB418\uB294 \uCF54\uB4DC\uB97C \uC5BB\uACE0 \uB09C \uD6C4\uC5D0 \uCF54\uB4DC \uC0C1\uC5D0 \uBA85\uD655\uD558\uAC8C \uB4DC\uB7EC\uB098\uB294 \uCC45\uC784\uB4E4\uC744 \uC62C\uBC14\uB978 \uC704\uCE58\uB85C \uC774\uB3D9\uC2DC\uD0A4\uB294 \uAC83\uC774\uB2E4.</p><p>\uC774\uCC98\uB7FC \uC774\uD574\uD558\uAE30 \uC27D\uACE0 \uC218\uC815\uD558\uAE30 \uC26C\uC6B4 \uC18C\uD504\uD2B8\uC6E8\uC5B4\uB85C \uAC1C\uC120\uD558\uAE30 \uC704\uD574 \uAC89\uC73C\uB85C \uBCF4\uC774\uB294 \uB3D9\uC791\uC740 \uBC14\uAFB8\uC9C0 \uC54A\uC740 \uCC44 \uB0B4\uBD80 \uAD6C\uC870\uB97C \uBCC0\uACBD\uD558\uB294 \uAC83\uC744 **\uB9AC\uD329\uD130\uB9C1(Refactoring)**\uC774\uB77C\uACE0 \uBD80\uB978\uB2E4.</p><h3 id="\u1106\u1166\u1109\u1165\u1103\u1173-\u110B\u1173\u11BC\u110C\u1175\u11B8\u1103\u1169" tabindex="-1"><a class="header-anchor" href="#\u1106\u1166\u1109\u1165\u1103\u1173-\u110B\u1173\u11BC\u110C\u1175\u11B8\u1103\u1169" aria-hidden="true">#</a> \uBA54\uC11C\uB4DC \uC751\uC9D1\uB3C4</h3><p>\uAE34 \uBA54\uC11C\uB4DC\uB294 \uB2E4\uC591\uD55C \uCE21\uBA74\uC5D0\uC11C \uCF54\uB4DC\uC758 \uC720\uC9C0\uBCF4\uC218\uC5D0 \uBD80\uC815\uC801\uC778 \uC601\uD5A5\uC744 \uBBF8\uCE5C\uB2E4.</p><ul><li>\uC5B4\uB5A4 \uC77C\uC744 \uC218\uD589\uD558\uB294\uC9C0 \uD55C\uB208\uC5D0 \uD30C\uC545\uD558\uAE30 \uC5B4\uB835\uAE30 \uB54C\uBB38\uC5D0 \uCF54\uB4DC\uB97C \uC804\uCCB4\uC801\uC73C\uB85C \uC774\uD574\uD558\uB294\uB370 \uB108\uBB34 \uB9CE\uC740 \uC2DC\uAC04\uC774 \uAC78\uB9B0\uB2E4.</li><li>\uD558\uB098\uC758 \uBA54\uC11C\uB4DC \uC548\uC5D0\uC11C \uB098\uBB34 \uB9CE\uC740 \uC791\uC5C5\uC744 \uCC98\uB9AC\uD558\uAE30 \uB584\uBB38\uC5D0 \uBCC0\uACBD\uC774 \uD544\uC694\uD560 \uB54C \uC218\uC815\uD574\uC57C \uD560 \uBD80\uBD84\uC744 \uCC3E\uAE30 \uC5B4\uB835\uB2E4.</li><li>\uBA54\uC11C\uB4DC \uB0B4\uBD80\uC758 \uC77C\uBD80 \uB85C\uC9C1\uB9CC \uC218\uC815\uD558\uB354\uB77C\uB3C4 \uBA54\uC11C\uB4DC\uC758 \uB098\uBA38\uC9C0 \uBD80\uBD84\uC5D0\uC11C \uBC84\uADF8\uAC00 \uBC1C\uC0DD\uD560 \uD655\uB960\uC774 \uB192\uB2E4.</li><li>\uB85C\uC9C1\uC758 \uC77C\uBD80\uB9CC \uC7AC\uC0AC\uC6A9\uD558\uB294 \uAC83\uC774 \uBD88\uAC00\uB2A5\uD558\uB2E4.</li><li>\uCF54\uB4DC\uB97C \uC7AC\uC0AC\uC6A9\uD558\uB294 \uC720\uC77C\uD55C \uBC29\uBC95\uC740 \uC6D0\uD558\uB294 \uCF54\uB4DC\uB97C \uBCF5\uC0AC\uD574\uC11C \uBD99\uC5EC\uB123\uB294 \uAC83\uBFD0\uC774\uBBC0\uB85C \uCF54\uB4DC \uC911\uBCF5\uC744 \uCD08\uB798\uD558\uAE30 \uC27D\uB2E4.</li></ul><p>\uC704\uC5D0\uC11C \uC124\uBA85\uD55C \uC774\uB7EC\uD55C \uBA54\uC11C\uB4DC\uB97C **\uBAAC\uC2A4\uD130 \uBA54\uC11C\uB4DC(monster method)**\uB77C\uACE0 \uBD80\uB978\uB2E4.</p><p>\uC751\uC9D1\uB3C4\uAC00 \uB0AE\uC740 \uBA54\uC11C\uB4DC\uB294 \uB85C\uC9C1\uC758 \uD750\uB984\uC744 \uC774\uD574\uD558\uAE30 \uC704\uD574 \uC8FC\uC11D\uC774 \uD544\uC694\uD55C \uACBD\uC6B0\uAC00 \uB300\uBD80\uBD84\uC774\uB2E4.</p><p>\uC8FC\uC11D\uC744 \uCD94\uAC00\uD558\uB294 \uB313\uB2C8 \uBA54\uC11C\uB4DC\uB97C \uC791\uAC8C \uBD84\uD574\uD574\uC11C \uAC01 \uBA54\uC11C\uB4DC\uC758 \uC751\uC9D1\uB3C4\uB97C \uB192\uC5EC\uB77C.</p><p>\uB530\uB77C\uC11C \uAC1D\uCCB4\uB85C \uCC45\uC784\uC744 \uBD84\uBC30\uD560 \uB54C \uAC00\uC7A5 \uBA3C\uC800 \uD560 \uC77C\uC740 <strong>\uBA54\uC11C\uB4DC\uB97C \uC751\uC9D1\uB3C4 \uC788\uB294 \uC218\uC900\uC73C\uB85C \uBD84\uD574\uD558\uB294 \uAC83</strong>\uC774\uB2E4.</p><h3 id="\u1100\u1162\u11A8\u110E\u1166\u1105\u1173\u11AF-\u110C\u1161\u110B\u1172\u11AF\u110C\u1165\u11A8\u110B\u1173\u1105\u1169-\u1106\u1161\u11AB\u1103\u1173\u11AF\u110C\u1161" tabindex="-1"><a class="header-anchor" href="#\u1100\u1162\u11A8\u110E\u1166\u1105\u1173\u11AF-\u110C\u1161\u110B\u1172\u11AF\u110C\u1165\u11A8\u110B\u1173\u1105\u1169-\u1106\u1161\u11AB\u1103\u1173\u11AF\u110C\u1161" aria-hidden="true">#</a> \uAC1D\uCCB4\uB97C \uC790\uC728\uC801\uC73C\uB85C \uB9CC\uB4E4\uC790</h3><p>\uC790\uC2E0\uC774 \uC18C\uC720\uD558\uACE0 \uC788\uB294 \uB370\uC774\uD130\uB97C \uC790\uAE30 \uC2A4\uC2A4\uB85C \uCC98\uB9AC\uD558\uB3C4\uB85D \uB9CC\uB4DC\uB294 \uAC83\uC774 \uC790\uC728\uC801\uC778 \uAC1D\uCCB4\uB97C \uB9CC\uB4DC\uB294 \uC9C0\uB984\uAE38\uC774\uB2E4. (<strong>\uC790\uC2E0\uC758 \uB370\uC774\uD130\uB97C \uC790\uAE30 \uC2A4\uC2A4\uB85C \uCC98\uB9AC\uD558\uB3C4\uB85D \uB9CC\uB4E0\uB2E4\uB294\uAC83\uC774 \uCC45 \uC804\uBC18\uC801\uC73C\uB85C \uBC18\uBCF5\uB418\uBA70 \uC124\uBA85\uD558\uACE0 \uC788\uB2E4. \uB9E4\uC6B0 \uC911\uC694\uD568!</strong>)</p><p>\uB530\uB77C\uC11C \uBA54\uC11C\uB4DC\uAC00 \uC0AC\uC6A9\uD558\uB294 \uB370\uC774\uD130\uB97C \uC800\uC7A5\uD558\uACE0 \uC788\uB294 \uD074\uB798\uC2A4\uB85C \uBA54\uC11C\uB4DC\uB97C \uC774\uB3D9\uC2DC\uD0A4\uBA74 \uB41C\uB2E4.</p><p>\uBCF8\uC778\uC774 \uCC45\uC784 \uC8FC\uB3C4 \uC124\uACC4 \uBC29\uBC95\uC5D0 \uC775\uC219\uD558\uC9C0 \uC54A\uB2E4\uBA74 \uC77C\uB2E8 \uB370\uC774\uD130 \uC911\uC2EC\uC73C\uB85C \uAD6C\uD604\uD55C \uD6C4 \uC774\uB97C \uB9AC\uD329\uD130\uB9C1\uD558\uB354\uB77C\uB3C4 \uC720\uC0AC\uD55C \uACB0\uACFC\uB97C \uC5BB\uC744 \uC218 \uC788\uB2E4. \uADF8\uB7EC\uBBC0\uB85C \uCC98\uC74C\uBD80\uD130 \uCC45\uC784 \uC8FC\uB3C4 \uC124\uACC4 \uBC29\uBC95\uC744 \uB530\uB974\uB294 \uAC83\uBCF4\uB2E4 \uB3D9\uC791\uD558\uB294 \uCF54\uB4DC\uB97C \uC791\uC131\uD55C \uD6C4\uC5D0 \uB9AC\uD329\uD130\uB9C1\uD558\uB294 \uAC83\uC774 \uB354 \uD6CC\uB96D\uD55C \uACB0\uACFC\uBB3C\uC744 \uB0B3\uC744 \uC218\uB3C4 \uC788\uB2E4. \uCEA1\uC290\uD654, \uACB0\uD569\uB3C4, \uC751\uC9C0\uB3C4\uB97C \uC774\uD574\uD558\uACE0 \uD6CC\uB96D\uD55C \uAC1D\uCCB4\uC9C0\uD5A5 \uC6D0\uCE59\uC744 \uC801\uC6A9\uD558\uAE30 \uC704\uD574 \uB178\uB825\uD55C\uB2E4\uBA74 \uCC45\uC784 \uC8FC\uB3C4 \uC124\uACC4 \uBC29\uBC95\uC744 \uB2E8\uACC4\uC801\uC73C\uB85C \uB530\uB974\uC9C0 \uC54A\uB354\uB77C\uB3C4 \uC720\uC5F0\uD558\uACE0 \uAE54\uB054\uD55C \uCF54\uB4DC\uB97C \uC5BB\uC744 \uC218 \uC788\uC744 \uAC83\uC774\uB2E4.</p>',99),v=[k];function m(h,g){return s(),a("div",null,v)}var f=n(d,[["render",m],["__file","05\uC7A5_ \uCC45\uC784 \uD560\uB2F9\uD558\uAE30.html.vue"]]);export{f as default};
